import { StyleSheet,Dimensions} from 'react-native';
const warehousefullStyle = StyleSheet.create({
    bar:{
        borderRadius:5,
        height:10,
        color:'#003247',
        borderColor:'#003247',
        backgroundColor:'#003247',
        opacity:0.9,
        alignItems:'center'
    },
    text:{
        textAlign:'center',
        fontSize:24
    },
});
export {warehousefullStyle};
